import React, { useEffect } from "react";
import UsersCatalog from "../components/UsersCatalog";

const Users = (props) => {
  useEffect(() => {
    fetch("http://localhost:5001/api/users");
  }, []);

  return <UsersCatalog bits={USERS} />;
};

export default Users;
